import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography
} from '@material-ui/core';

export default class App extends React.Component{
  render(){
    return(
      <AppBar>
        <Toolbar>
          <Typography>Mobile Security</Typography>
        </Toolbar>
      </AppBar>
    );
  };
};
